export default function totalToRender(profileDataToRender, totalToRenderNumber) {
  let container = []

  console.log(profileDataToRender.length)

  // console.log(profileDataToRender.slice(0, totalToRenderNumber))

  try {
    for (let i = 0; i < totalToRenderNumber; i++) {
      if (!profileDataToRender[i]) break
      container.push(profileDataToRender[i])
    }
  }
  catch {return container}

  return container
}
